    [],nt"revision_timestamp": "2015-08-21T22:30:55.294742",nt"name": "clinical-information-support-system-ciss",nt"isopen":
    true,nt"url": null,nt"notes": "Clinical Information Support System (CISS)
    is a web-based portal application that provides a framework of services for the
    VA enterprise and supplies an integration point for its partner systems. The initial
    CISS partner system is the Occupational Health Record-keeping System (OHRS), a web-based
    application that enables employee occupational health staff to create, maintain,
    and monitor medical records for VA employees and generate national, Veterans Integrated
    Service Network (VISN), and site-specific reports.The CISS portal is development
    in the delivery of information and applications to the clinical user community.
    It provides a single point of access for the clinical user's application and information
    needs, facilitating faster and more efficient patient care.The CISS framework further
    establishes a foundation for publishing any type of application, including clinical,
    non-clinical, HealtheVet, and legacy applications. These plug-in applications, called
    'partner systems', can be developed independently and published to the users through
    the CISS portal. The CISS Program development team uses repeatable Agile development,
    management and support processes to rapidly develop quality software in 6-month
    release cycles, improving efficiency and customer satisfaction.",nt"license_title":
